script: |
  super -f text -I q2841.spq | sort > q2841.out

inputs:
  - name: q2841.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE NOT NULL BETWEEN - + col1 * + + col2 * - - 57 - ( - col0 ) + col0 * col2 + + 92 AND - 10;
  - name: tab2

outputs:
  - name: q2841.out
    data: |
